import React from 'react'
import tumkampanyalar from '../pages/tumkampanyalar'

import { Container, Divider, Grid, Segment } from "semantic-ui-react";
import { Route } from 'react-router';

export default function Dashboard2() {
    return (
        <Grid>
        <Grid.Row>
          <Grid.Column>
            <Grid.Column>
            <Route exact path="/tumkampanyalar" component={tumkampanyalar} /> 
            </Grid.Column>
          </Grid.Column>
        </Grid.Row>
      </Grid>
    )
}
